穿着方式。邵雨薇跟杨小黎笑说女生都喜欢把绳子穿过制服下摆绑起来，还有一定要把衣服的袖子反折。陈大天则是被全班笑封高腰裤男孩的老实平头男，小乐还自爆他国高中穿衣风格差超多，“国中时候要穿垮裤垮到内裤露一大半出来，但高中却是要把裤子改窄才帅。”。&nbsp;被问到念书时期是否就已是风云人物，邵雨薇害羞笑说“其实我私下蛮安静的，不是很出风头的类型，但国中时校花比赛有被选上校花过。”。小乐说自己从小就是喜欢耍宝逗大家开心的类型，但被问到是否很受异性欢迎时，立刻害羞的用搞笑腔调说“还行啦！还行！”。陈大天则是笑说自己因为上课都很吵闹，座位都是被发配在边疆，不是在垃圾桶旁边不然就是第一排的特别座。杨小黎则因为是读女中又是热音社主唱，笑说自己有不少被学妹示好的经验。</span<br />";s:13:"vod_play_from";s:15:"dbm3u8$$$gqm3u8";s:15:"vod_play_server";s:7:"no$$$no";s:13:"vod_play_note";s:3:"$$$";s:12:"vod_play_url";s:2119:"01$https://dbx3.tyswmp.com/20190429/eb7UbYAb/index.m3u8#02$https://dbx3.tyswmp.com/20190429/mCkCQ8SL/index.m3u8#03$https://dbx3.tyswmp.com/20190429/q9VYBA/index.m3u8#04$https://dbx3.tyswmp.com/20190429/xv8a18mt/index.m3u8#05$https://dbx3.tyswmp.com/20190429/mFUyjjs4/index.m3u8#06$https://dbx3.tyswmp.com/20190429/Y4zYhhAj/index.m3u8#07$https://dbx3.tyswmp.com/20190429/QRU8nWSt/index.m3u8#08$https://dbx3.tyswmp.com/20190429/NQRZhJCd/index.m3u8#09$https://dbx3.tyswmp.com/20190429/IO9iDVmT/index.m3u8#10$https://dbx3.tyswmp.com/20190429/8bFfzMWk/index.m3u8#11$https://dbx3.tyswmp.com/20190429/Qd4hoKJN/index.m3u8#12$https://dbx3.tyswmp.com/20190429/HJUvOAQ5/index.m3u8#13$https://dbx3.tyswmp.com/20190429/eXIkCz9y/index.m3u8#14$https://dbx3.tyswmp.com/20190429/goclzQyf/index.m3u8#15$https://dbx3.tyswmp.com/20190429/8BpyAhOX/index.m3u8#16$https://dbx3.tyswmp.com/20190429/sC8t2d6u/index.m3u8#17$https://dbx3.tyswmp.com/20190429/XwZ4fSKe/index.m3u8$$$01$https://gaoqing2.jongta.com/2018/10/25/A2AwYkSfalizKzP0/playlist.m3u8#02$https://gaoqing2.jongta.com/2018/10/25/cuYFvAXFQAOUnnzw/playlist.m3u8#03$https://gaoqing2.jongta.com/2018/10/25/yUEGLBwQhINxwrDB/playlist.m3u8#04$https://gaoqing2.jongta.com/2018/10/25/dRaVta35ysrI5R7N/playlist.m3u8#05$https://gaoqing2.jongta.com/2018/10/25/ZAhDpsTBQQPxcV2X/playlist.m3u8#06$https://gaoqing2.jongta.com/2018/10/25/nX0xgSwlYCKX5qXb/playlist.m3u8#07$https://gaoqing2.jongta.com/2018/10/25/3OC7L6Jr1mPJuCdn/playlist.m3u8#08$https://gaoqing2.jongta.com/2018/10/25/9RR8HbAtjfL